import React from "react";
import { lolosArrowForward } from "react-icons/io";
import { FaAngleRight } from "react-icons/fa";
import { Link } from "react-router-dom";

function Audits({ homeAudits }) {
  return (
    <div>
      {homeAudits.map((audit, index) => {
        const { tenantid, tenantName, timeRemaining, status, date } = audit;
        return (
          <div className="homeaudit-container">
            <div>{tenantName}</div>
            {audit.status === "resolved" ? (
              <div>resolved</div>
            ) : (
              <div>unresolved</div>
            )}
            <FaAngleRight>
              <Link to={`/institution/${tenantid}`}></Link>
            </FaAngleRight>
          </div>
        );
      })}
    </div>
  );
}

export default Audits;
